import "./Banner.css"

const Banner = () => {
    return (<div>

        <div className="banner-bg">
            <img src="./imagens/wpp-ciber.jpg" />
            <div className="box" >
                <h1>Faraway</h1>



            </div>

        </div>


    </div>);
}

export default Banner;
